function App() {
  return (
    <div className="App">
<BrowserRouter>
<Routes>
  <Route path="/" element={<Header/>}></Route>
  {/* <Route path="/" element={<Home/>}></Route> */}
</Routes>
</BrowserRouter>


    </div>
  );
}

export default App;
